/** @format */
import React from "react";
import "./App.css";
import CreateTodo from "./components/CreateTodo";
import TodosList from "./components/TodosList";
import Navbar from "./components/Navbar";

function App() {
  return (
    <>
      <Navbar />
      <div className="container">
        <CreateTodo />
        <TodosList />
      </div>
    </>
  );
}

export default App;
